import React, { useEffect } from "react";

function BuildCard({ el }) {
  console.log(el);
  return (
    <div className='card'>
      <h3>{el.buildname} </h3>
      <img
        className='buildcardIMG'
        src={el.photos[0] && el.photos[0].backgroundimage[0] ? el.photos[0] && el.photos[0].backgroundimage[0] : ""}
        alt='background'
      />
    </div>
  );
}

export default BuildCard;
